import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from './pages/Home'
import './App.css';

function App() {
  return (
    <Router>
    <Switch>
      <Route exact path="/" component={Home} />
    </Switch>
  </Router>
  );
}

export default App;
